import classNames from "classnames";
import styles from "./styles.module.css";

export const DeletePopup = ({id, toggleDeletePopup}) => {

    const deleteUser = () => {
        // dispatch thunk delete
        console.log('User' + id + 'was deleted');
        toggleDeletePopup()
    } 
    return (
        <div className={styles.popup_wrapper}>
            <div className={styles.popup}>
                <h2 className={styles.title}>Удалить пользователя?</h2>
                <div className={styles.buttons_wrapper}>
                    <button type='button' className={classNames(styles.button, styles.submit)} onClick={() => deleteUser()}>Да</button>
                    <button type='button' className={classNames(styles.button, styles.cancel)} onClick={() => toggleDeletePopup()}>Нет</button>
                </div>
            </div>
        </div>
    )
}
